import React from 'react';
import { DownOutlined, SmileOutlined } from '@ant-design/icons';
import type { MenuProps } from 'antd';
import { Dropdown, Space } from 'antd';

const items: MenuProps['items'] = [
  {
    key: '1',
    label: (
      <a target="_blank" rel="noopener noreferrer" href="https://www.antgroup.com">
        1st menu item
      </a>
    ),
  },
  {
    key: '2',
    label: (
      <a target="_blank" rel="noopener noreferrer" href="https://www.aliyun.com">
        2nd menu item (disabled)
      </a>
    ),
    icon: <SmileOutlined />,
    disabled: true,
  },
  {
    key: '3',
    label: (
      <a target="_blank" rel="noopener noreferrer" href="https://www.luohanacademy.com">
        3rd menu item (disabled)
      </a>
    ),
    disabled: true,
  },
  {
    key: '4',
    danger: true,
    label: 'a danger item',
  },
];
function NavDropDown({ title, url, childrens }: ItemDropDown) {

  return (<>
  <div className="nav-link">
    
  </div>
    <div className={styles.dropdowBox}>
      <a className={`nav-link fw-bold ${styles.dropdow}`}>{title} <i className="fa-solid fa-chevron-down"></i></a>
      <div className={` ${styles.dropdowContent}`}>
        {
          childrens?.map((e) => (<>
            <Link to={e.url} className={`nav-link ${styles.dropdowItem}`}>{e.title}</Link>
          </>))
        }
      </div>
    </div>
  </>);
}
export default NavDropDown;
